import React from "react";
import NavBar from "./components/NavBar";
import CommandList from "./components/CommandList";
import DOA from "./components/DOA";

function App() {
  return (
    <div>
      <NavBar />
      <DOA width={50} height={50} />
      <CommandList />
    </div>
  );
}

export default App;
